import React, { useState } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

// นำเข้ารูปภาพ
import slide1 from './images/40.jpg';
import slide2 from './images/50.jpg';
import slide3 from './images/60.jpg';
import blogImage1 from './images/blog1.jpg';
import blogImage2 from './images/blog2.jpg';
import blogImage3 from './images/blog3.jpg';
import blogImage4 from './images/blog4.jpg';

const Home = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedBlog, setSelectedBlog] = useState(null); // State สำหรับเก็บข้อมูลที่แสดงเมื่อคลิก

  // การตั้งค่าของ Slick Slider
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  // ข้อมูลบล็อก
  const items = [
    { id: 1, title: "", image: blogImage1, content: "This is the content for Blog Post 1.", link: "https://ikspet.com/%E0%B8%9C%E0%B8%B1%E0%B8%81%E0%B9%81%E0%B8%A5%E0%B8%B0%E0%B8%9C%E0%B8%A5%E0%B9%84%E0%B8%A1%E0%B9%89%E0%B8%97%E0%B8%B5%E0%B9%88%E0%B8%AA%E0%B8%B8%E0%B8%99%E0%B8%B1%E0%B8%82%E0%B8%81%E0%B8%B4%E0%B8%99/?srsltid=AfmBOooxDV8m1ABYFJ8YafX-yF3jeOgqzKr7JhchpkHb1zY19U13mTKX" },
    { id: 2, title: "", image: blogImage2, content: "This is the content for Blog Post 2.", link: "https://www.petexpothailand.net/" },
    { id: 3, title: "", image: blogImage3, content: "This is the content for Blog Post 3.", link: "https://www.thestreetratchada.com/Blogs/175/Best-Pet-for-Your-Zodiac" },
    { id: 4, title: "", image: blogImage4, content: "This is the content for Blog Post 4.", link: "https://hdmall.co.th/blog/c/dog-bite-first-aid/" },
  ];

  // ฟังก์ชันกรองข้อมูลบล็อก
  const filteredItems = items.filter(item =>
    item.title.toLowerCase().includes(searchQuery.toLowerCase())
  );

  const handleImageClick = (blogContent) => {
    setSelectedBlog(blogContent); // เมื่อคลิกที่รูป จะเก็บข้อมูลข้อความ
  };

  return (
    <div className="home">
      {/* ช่องค้นหา */}
      <div className="search-container">
        <input
          type="text"
          placeholder="Search ..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="search-input"
        />
      </div>

      {/* สไลด์รูปภาพ */}
      <Slider {...settings}>
        <div>
          <img src={slide1} alt="Slide 1" />
        </div>
        <div>
          <img src={slide2} alt="Slide 2" />
        </div>
        <div>
          <img src={slide3} alt="Slide 3" />
        </div>
      </Slider>

      {/* แสดงบล็อก */}
      <div className="blog-list">
        <h2></h2>
        <div className="blogs">
          {filteredItems.length > 0 ? (
            filteredItems.map(item => (
              <div key={item.id} className="blog-item">
                {/* วางโค้ด <a> ที่ปรับแต่งแล้วตรงนี้ */}
                <a
                  href={item.link}
                  target="_blank" // เปิดลิงก์ในแท็บใหม่
                  rel="noopener noreferrer" // ป้องกันช่องโหว่ความปลอดภัย
                  onClick={(e) => {
                    e.stopPropagation(); // ป้องกันการกระทำอื่นๆ จากฟังก์ชัน
                    handleImageClick(item.content); // แสดงข้อความจากบล็อกที่คลิก
                  }}
                >
                  <img src={item.image} alt={item.title} />
                  <div className="title">{item.title}</div>
                </a>
              </div>
            ))
          ) : (
            <p>No blogs found</p>
          )}
        </div>
      </div>

      {/* แสดงผลข้อความเมื่อคลิกที่รูปภาพ */}
      {selectedBlog && (
        <div className="selected-blog-content">
          <h3></h3>
          <p>{selectedBlog}</p>
        </div>
      )}

      {/* แสดงผลลัพธ์การค้นหา */}
      <div className="search-results">
        <ul>
          {filteredItems.length > 0 ? (
            filteredItems.map(item => (
              <li key={item.id} className="result-item">{item.title}</li>
            ))
          ) : (
            <li>No results found</li>
          )}
        </ul>
      </div>
    </div>
  );
}

export default Home;
